import React,{useState} from 'react'

const App = () => {
  const [count, setCount]=useState(0);

  return (
    <div>
      <Button count={count} setCount={setCount}/>
    </div>
  )
}

function Button(props){
  const handleClick=()=>{
    props.setCount(count+1);
  }
  return (
    <>
    <button onClick={handleClick}>count as {props.count}</button>
    </>
  )
}

export default App
